// 将明文变为list_companies4_list_by_codes的请求参数
function o_map(a) {
    // search_mi是解密方法  需传入search_company_for_lib密文
    r = search_mi(a)
    v = r.data.map(function (e) {
        return e.company_code
    })
    n = {
        payload: {
            codes: v
        }
    }
    var l = JSON.stringify(n)
        , s = JSON.parse(l);
    var f = stt.e1(stt.e2(JSON.stringify(s.payload)))
        , p = stt.sig(f);
    return {
        payload: f,
        sig: p,
        v: 1,
    }
}

